import React from 'react';


import "./css/app.css";
import PathFindApp from './react/pages/pathfind-page';
import InstructionsPage from './react/pages/instructions-what-is-an-algorithm-page';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'



function App() {
  return (
    <Router>
      <div className="app">
        <Route path="/" component={InstructionsPage}>
          {/* <InstructionsPage></InstructionsPage> */}
        </Route>
        <Route path="/Play" component={PathFindApp}>
          {/* <PathFindApp></PathFindApp> */}
        </Route>
      </div>
    </Router>
  );
}

export default App;
